INSERT INTO product VALUES
(1, 'ABAHNA Mandarin & Sicilian Bergamot Soap', 'Abahna Mandarin and Sicilian Bergamot Soap ― великолепное мыло от английской компании Абана. Производится методом тройной очистки из натуральных растительных экстрактов. Не содержит в составе СЛС, парабенов и искусственных красителей. Подходит для ежедневного использования, так как является абсолютно безвредным для кожи.\n\nГлавными активными компонентами мыла Абана Мандарин и Сицилийский Бергамот выступают следующие вещества:\n\nэкстракт цветочного меда, известный своими лечебными свойствами;\nглицерин, увлажняющий и восстанавливающий кожу;\nмасла карите и кокоса, насыщающие клетки эпидермиса питательными веществами и активирующие их защитные функции.\nМыло Абана Мандарин и Сицилийский бергамот имеет потрясающий цитрусовый аромат. Он помогает взбодриться и обрести душевное равновесие.', 'abahna-mandarin-sicilian-bergamot-soap', NULL, NULL, 1, NULL, NULL, NULL, 0, 'ABAHNA_Mandarin_&_Sicilian_Bergamot_Soap_170_ml_.jpg', 1, 0, '2017-12-30 17:39:04', '2017-12-30 17:39:04'),
